import styled from "styled-components";

export const TabBarContainer = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  height: 100vh;
  width: 100%;
`;

export const TodoItem = styled.div`
  display: flex;
  align-items: center;
  margin-top: 15px;
  padding: 0;
`;
